import React, { useState, useEffect } from "react";
import axios from "axios";

const API = process.env.REACT_APP_API || "http://localhost:5000/api";

const styles = {
  container: { padding: "20px", fontFamily: "Arial, sans-serif" },
  section: {
    background: "rgba(255,255,255,0.9)",
    padding: "20px",
    borderRadius: "10px",
    marginBottom: "20px",
    boxShadow: "0 2px 8px rgba(0,0,0,0.2)",
  },
  heading: { marginBottom: "10px" },
  input: { padding: "10px", width: "70%", marginRight: "10px" },
  button: { padding: "10px" },
  card: {
    border: "1px solid #ccc",
    padding: "10px",
    borderRadius: "8px",
    marginBottom: "8px",
  },
};

export default function EmployeeDashboard({ user, logout }) {
  const [attendance, setAttendance] = useState([]);
  const [appointments, setAppointments] = useState([]);
  const [medicines, setMedicines] = useState([]);
  const [newAppointment, setNewAppointment] = useState("");

  useEffect(() => {
    fetchAttendance();
    fetchAppointments();
    fetchMedicines();
  }, []);

  const fetchAttendance = async () => {
    try {
      const res = await axios.get(`${API}/employee/attendance`, {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setAttendance(res.data);
    } catch (err) {
      console.error(err);
      alert("Failed to fetch attendance");
    }
  };

  const fetchAppointments = async () => {
    try {
      const res = await axios.get(`${API}/employee/appointments`, {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setAppointments(res.data);
    } catch (err) {
      console.error(err);
      alert("Failed to fetch appointments");
    }
  };

  const fetchMedicines = async () => {
    try {
      const res = await axios.get(`${API}/medicines`, {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setMedicines(res.data);
    } catch (err) {
      console.error(err);
      alert("Failed to fetch medicines");
    }
  };

  const bookAppointment = async () => {
    if (!newAppointment) return alert("Enter appointment details");
    try {
      const res = await axios.post(
        `${API}/employee/appointments`,
        { details: newAppointment },
        { headers: { Authorization: `Bearer ${localStorage.getItem("token")}` } }
      );
      setAppointments([...appointments, res.data]);
      setNewAppointment("");
      alert("Appointment booked!");
    } catch (err) {
      console.error(err);
      alert("Failed to book appointment");
    }
  };

  return (
    <div style={styles.container}>
      <h2>Welcome, {user.name} (Employee)</h2>
      <button onClick={logout}>Logout</button>

      {/* Attendance Section */}
      <div style={styles.section}>
        <h3 style={styles.heading}>Attendance</h3>
        {attendance.length === 0 ? (
          <p>No attendance records</p>
        ) : (
          attendance.map((a) => (
            <div key={a._id} style={styles.card}>
              Date: {a.date} | Status: {a.status}
            </div>
          ))
        )}
      </div>

      {/* Appointments Section */}
      <div style={styles.section}>
        <h3 style={styles.heading}>Appointments</h3>
        {appointments.length === 0 ? (
          <p>No appointments</p>
        ) : (
          appointments.map((a) => (
            <div key={a._id} style={styles.card}>
              {a.details} | Date: {a.date}
            </div>
          ))
        )}
        <input
          style={styles.input}
          placeholder="New Appointment"
          value={newAppointment}
          onChange={(e) => setNewAppointment(e.target.value)}
        />
        <button style={styles.button} onClick={bookAppointment}>
          Book Appointment
        </button>
      </div>

      {/* Medicines Section */}
      <div style={styles.section}>
        <h3 style={styles.heading}>Medicines</h3>
        {medicines.length === 0 ? (
          <p>No medicines</p>
        ) : (
          medicines.map((m) => (
            <div key={m._id} style={styles.card}>
              {m.name} | Quantity: {m.quantity}
            </div>
          ))
        )}
      </div>
    </div>
  );
}
